import React from "react";
import "./HeroStyles.css";
const Hero = () => {
  return (
    <>
      <div className="hero">
        <img
          alt="HeroImg"
          src="https://images.unsplash.com/photo-1469474968028-56623f02e42e?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8bmF0dXJlfGVufDB8fDB8fHww&auto=format&fit=crop&w=1000&q=60"
        />
      </div>
    </>
  );
};

export default Hero;
